package programs;

public class Factorial {
	
	static int n=5, f=1;

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		 
		for(int i=1;i<=n;i++){
			
			f=f*i;
		}
		
		System.out.println(f);
		
		//2nd logic-----------------------
		int f=1;
		for(int i=1;i<=6;i++){
			
			 f=f*i;
		}
System.out.println(f);
	}

}
